function recuperarItemsCarrito(){fetch("/cart.js").then(function(t){if(!t.ok)throw Error(t.statusText);return t.json()}).then(function(t){for(let e=0;e<t.items.length;e++)console.log("Titulo: "+t.items[e].title+", precio: "+t.items[e].price+", cantidad: "+t.items[e].quantity+", enlace a su imagen: "+t.items[e].image)}).catch(function(t){console.log("Ha habido un problema: ",t)})}alert("Script cargado");